import React from "react";
import { connect } from "react-redux";

const ActiveUsers = ({ username }) => {
    return (
        <div>
            <p>Active users: {}</p>
        </div>
    );
};
const mapStateToProps = state => ({
    username: state.userReducer.username
});

export default connect(mapStateToProps)(ActiveUsers);
